def plot_theta_vs_t(angle_list_deg, color, t_min_ns=0.5, t_max_ns=5):
    ts = np.linspace(t_min_ns, t_max_ns, len(angle_list_deg))
    plt.plot(ts, np.array(angle_list_deg),c=color)
    plt.plot([0, t_max_ns+1], [90, 90], c='gray', ls='--')
    plt.ylabel('$\\theta$ / deg')
    plt.xlabel('$t$ / ns')
    plt.ylim(35, 145)
    plt.xlim(0, t_max_ns)
    plt.tight_layout()
    return plt.show()


def bimodal_func(x, a, b, c, d, e, f):
    return a * np.exp(-e*(x+b)**2) + c * np.exp(-f*(x+d)**2)


def plot_hist(angle_list_deg, color, label, min_theta=-90, max_theta=90, index=None, lc='k', bimodal=False):

    mean = np.mean(angle_list_deg)
    variance = np.var(angle_list_deg)
    sigma = np.sqrt(variance)
    print(sigma)

    x = np.linspace(min_theta, max_theta, 200)
    if bimodal:
        x0 = (0.01, -30.0, 0.01, 10.0, 0.2, 0.2)
        hist, bin_edges = histogram(angle_list_deg, bins=20, density=True)
        params, _ = curve_fit(bimodal_func, np.linspace(min_theta, max_theta, 20), hist, x0)
        print(params)
        ax[index].plot(x, [bimodal_func(x_val, *[1.91970391e-02, -4.05310767e+01,  1.91970391e-02,  4.03480337e+01, 2.84526648e-03,  2.49712125e-03]) for x_val in x], ls='--', linewidth=1.0, color=lc)

    else:
        ax[index].plot(x, mlab.normpdf(x, mean, sigma), ls='--', linewidth=1.0, color=lc)

    # the histogram of the data
    ax[index].hist(angle_list_deg, bins=15, color=color, density=1, label=label, edgecolor='gray', linewidth=0.5)
    # ax[index].legend([label])
    ax[index].set_yticks([])
    ax[index].set_xlabel('$\\theta$ / deg')
    ax[index].set_ylabel('Frequency')
    plt.xlim(min_theta, max_theta)
    return


